import React, { Component } from 'react';

import Config from './config/config';

import './App.css';

class App extends Component {
  state = {
    Config
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1> Coupons App!</h1>

        </header>
      </div>
    );
  }
}

export default App;
